        $batchSize = 20;
        $i = 1;  
        foreach ($dados as $key => $value):            
            
            $mg = new Mg(); 
            $mg->setId($value[0]);
            $mg->setCidade(utf8_decode($value[1]));
            $mg->setLogradouro(utf8_decode($value[2]));
            $mg->setBairro(utf8_decode($value[3]));
            $mg->setCep($value[4]);
