            $manager->persist($mg);
            if (($i % $batchSize) === 0) {
                $size = new Size();
                echo 'Flushing batch...' . "\n";
                echo 'Memory: ' . $size->getReadableSize(memory_get_usage()) . "\n";

                $manager->flush();
                $manager->clear();

                echo 'After batch...' . "\n";
                echo 'Memory: ' . $size->getReadableSize(memory_get_usage()) . "\n"; 
                unset($size);
            }            
            $i++;
            unset($mg);
            
        endforeach;        

        $manager->flush(); 
        $manager->clear();   	        
